    function verifyProof(
        uint256[2] memory a,
        uint256[2][2] memory b,
        uint256[2] memory c,
        uint256[5] memory input
    ) external view returns (bool);
}

// CardDraw: 5 public inputs [deckCommitment, drawCommitment, drawIndex, gameId, playerCommitment]
